$(document).ready(function(){});window.request_address_async=()=>{window.dispatchEvent(new CustomEvent("ICONEX_RELAY_REQUEST",{detail:{type:"REQUEST_ADDRESS"}})),window.addEventListener("ICONEX_RELAY_RESPONSE",n=>{const{type:t,payload:i}=n.detail;t==="RESPONSE_ADDRESS"&&console.log(i)})};window.request_signing_async=(n,t)=>{window.dispatchEvent(new CustomEvent("ICONEX_RELAY_REQUEST",{detail:{type:"REQUEST_SIGNING",payload:{from:n,hash:t}}}))};window.request_has_account_async=()=>{window.dispatchEvent(new CustomEvent("ICONEX_RELAY_REQUEST",{detail:{type:"REQUEST_HAS_ACCOUNT"}}))};